import '../assets/css/App.css';

import TopBar from '../components/topbar/TopBar';
import ListStudents from '../components/list-students/ListStudents';
import Footer from '../components/footer/Footer';
import NewStudent from './new-student/NewStudent';
import EditStudent from './edit-student/EditStudent';


import {BrowserRouter as Router, Route, Switch} from 'react-router-dom';


function App() {

  return (
    <Router>
      <Switch>
              <TopBar className="App App-header"></TopBar>

            <Route exact path="/">

                <ListStudents className="App-content"></ListStudents>

            </Route>
            <Route exact path="/new-student">

                <NewStudent className="App-content"></NewStudent>

            </Route>
            <Route exact path="/edit-student">

                <EditStudent className="App-content"></EditStudent>

            </Route>

              <Footer  className="App-footer"></Footer>


      </Switch>
    </Router>
  );
}

export default App;
